const INITIAL_STATE = {
  data:[]
}

export default function AssetDevicesReducer(INITIAL_STATE = [], action) {
    switch (action.type) {
      case "FETCH_ASSET_DEVICES":
        return {
          data: [...state.data, action.payload]
        };
      default:
        return state;
    }
  }
